function Table(props) {
  console.log(props.apiData);

  if (!props.apiData.results) {
    // If the API request isn't completed return "loading...""
    return <p>Loading...</p>;
  } else {

    const table = document.createElement('table');
    const thead = document.createElement('thead');
    const tbody = document.createElement('tbody');

    const headerRow = document.createElement('tr');
    for (const key in props.apiData.results[0]) {
      if (key === 'ContinentCode' || key === 'CountryCode') {
        continue;
      } else {
        const th = document.createElement('th');
        th.textContent = key;
        headerRow.appendChild(th);
      }
    }
    thead.appendChild(headerRow);
    table.appendChild(thead);

    // Create table rows and fill with data
    for (const key in props.apiData.results) {
      const row = document.createElement('tr');
      for (const inside in props.apiData.results[key]) {
        if (inside === 'ContinentCode' || inside === 'CountryCode') {
          continue;
        } else {
          const cell = document.createElement('td');
          cell.textContent = props.apiData.results[key][inside];
          row.appendChild(cell);
        }
      }
      tbody.appendChild(row);
    }

    table.appendChild(tbody)
    return table;
  }
}

export default Table;
